    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE + col1 + - col2 NOT IN ( 40, - col2 + - ( + col1 ) + + 44 );
  - name: tab1

outputs:
  - name: q11310.out
    data: |
      51	14	96
      85	5	59
      91	47	68
